import React, { StrictMode } from 'react';
import ReactDOM from 'react-dom';
import store from './store'
import './index.css';
import App from './App';
import { Provider } from 'react-redux'

store.subscribe(() => console.log(store.getState()))
ReactDOM.render(
    <StrictMode>
    <Provider>
        <App />
    </Provider>
    </StrictMode>
    , document.getElementById('root'));
